// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

interface IPay {
    function paySalary(address payable _to) external payable;
}

contract SalaryPay {
    struct Employee {
        string name;
        uint salary;
        Role role;
        Status status;
    }

    enum Role {MENTOR, ADMIN, SECURITY}
    enum Status {ACTIVE, PROBATION, TERMINATED}

    Employee[] public employee;
    mapping(address => Employee[]) amount;

    address payContract; // Address of contract implementing IPay

    constructor(address _payContract) {
        payContract = _payContract;
    }

    function registerUser(string memory _name, uint _salary, Role _role) external {
        employee.push(Employee(_name, _salary, _role, Status.ACTIVE));
    }

    // To pay the workers, first check if they're still employed, also check if the amount you're paying is higher than the agreed amount during registeration

    function payStaffs(uint _index, address payable _to, uint _amount) external payable {
        require(_index < employee.length, "User not found");
        require(_amount <= employee[_index].salary, "Wrong agreed salary");

        IPay(payContract).paySalary{value: _amount}(_to);
    }

    function getAllUsers() external view returns (Employee[] memory) {
        return employee;
    }
}


